import React from "react";
import Layout from "../../components/layout";
import { Tabs, TabList, TabPanels, Tab, TabPanel } from "@chakra-ui/react";
import PlayerList from "../../components/playerList";
import { getStaticProps } from "../index";

const Team = () => {
  const {
    props: { players, coaches },
  } = getStaticProps();

  console.log({ players, coaches });
  return (
    <Layout header="Players">
      <Tabs variant="enclosed">
        <TabList>
          <Tab>Bombers DI</Tab>
          <Tab>Bombers DIII</Tab>
        </TabList>
        <TabPanels>
          <TabPanel>
            <PlayerList forwards={[]} backs={[]} coaches={[]}></PlayerList>
          </TabPanel>
          <TabPanel>
            <PlayerList forwards={[]} backs={[]} coaches={[]}></PlayerList>
          </TabPanel>
        </TabPanels>
      </Tabs>
    </Layout>
  );
};

export default Team;
